	public boolean testOutsideInterval(double spikes[]) {
		int size = this.h.getHistSize();
		int i=0;
		// Checks if the histogram is set to zero in the beginning
		for (i=0; i<size; i++) {
			if (this.h.binEntries(i)!=0) {
				return false;
			}			
		}
		i=0;
		
		// Checks if the histogram is set to zero even after insert time samples
		// outside from histogram limits
		
		// Before 'a'
		while ( (spikes[i]<a) && (i<spikes.length) ) {
			this.h.fill(spikes[i]);
			i++;
		}
		while ( (spikes[i]<=b) && (i<spikes.length) ){
			i++;
		}
		// After 'b'
		while ( (spikes[i]>b) && (i<spikes.length-1) ){
			this.h.fill(spikes[i]);
			i++;
		}
		for (i=0; i<size; i++)  {
			if (this.h.binEntries(i)!=0) {
				return false;
			}
		}
		return true;
		
	}
	
	public boolean testTrainBasic (double spikes[], double counts[]) {
		
		if (counts.length!=h.getHistSize()) {
			System.out.println ("Bin size (s): "+this.h.getBinSize()+ " Different sizes: "+counts.length+"!="+h.getHistSize());
			return false;
		}
		
		if (!this.testOutsideInterval(spikes)) {
			System.out.println ("Before !!");
			return false;
		}
		h.reset();
		for (int i=0; i<spikes.length; i++) {
			
			h.fill(spikes[i]);
		}
		
		for (int i=0; i<counts.length; i++)  {
			if (counts[i]!=this.h.binEntries(i)) {
				System.out.println ("Wrong spike counting: "+counts[i]+"!="+this.h.binEntries(i));
				return false;
			}
		}
		return true;
		
	}
